import "./Footer.css";

export const Footer = () => {
  return (
    <footer className="container-footer">
      <p>
        Meet me <a className="white-text" href="https://www.github.com/rijalhnf">Github</a> or{" "}
        <a className="white-text" href="https://www.instagram.com/rijalhnf">Instgram</a>
      </p>
    </footer>
  );
};
